    def browse_code128(self) -> str:
        ext=['PNG','*']
        filters=';;'.join(['{e} Files(*.{e})'.format(e=i) for i in ext])
        save_file,extension=QFileDialog.getSaveFileName(filter=filters)
        print(save_file,extension)
        if Path(save_file).suffix != ".png":
            save_file+=".png"
        return save_file

    def generate_code128(self,code:str,fname:str) -> bool:
        try:
            from barcode.writer import ImageWriter
            from pathlib import Path
            from PIL import Image
            from barcode import Code128
            writer_options={'module_width':32,'module_height':1}
            writer1=ImageWriter()
            writer1.set_options(writer_options)
            Code128(str(code),writer=writer1).write(fname)
            #resize with PIL
            img=Image.open(fname)
            img=img.resize((92*4,4*2))
            new_name='{}2{}'.format(Path(fname).stem,Path(fname).suffix)
            img.save(new_name)
            if Path(fname).exists():
                Path(fname).unlink()
            if Path(new_name).exists():
                Path(new_name).rename(fname)
            return True
        except Exception as e:
            print(e)
            return False




